    "chautauqua-national-wildlife-refuge-narrative-report-may-june-july-and-august-1947",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Chautauqua NWR
    outlines Refuge accomplishments from May through August of 1947. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, furbearers, predators, rodents, mammals,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments. Resource management is outlined; topics include
    commercial fishing. The public relations section of the report describes recreational
    uses, Refuge visitors, and violations. N-R forms are attached.",nt"license_title":
